from unittest.mock import Mock, patch
from fastapi import HTTPException
from fastapi.testclient import TestClient

from goldmine.toolkit.api import create_app
from goldmine.toolkit.interface import ModelInterface
from goldmine.types import (
    ToolState,
    ToolInfo,
    LoadResponse,
    UnloadResponse,
    ToolInput,
    ToolOutput,
    ToolResponse,
    ToolBatchInput,
    ToolBatchResponse,
    PhenotypeMatch,
)


class MockModelImplementation(ModelInterface):
    """Mock implementation for testing API endpoints."""

    def __init__(self):
        super().__init__()
        self.load_response = LoadResponse(
            state=ToolState.READY, loading_time=1.0, message="Loaded"
        )
        self.unload_response = UnloadResponse(
            state=ToolState.UNLOADED, message="Unloaded"
        )
        self.should_raise_http_exception = False
        self.should_raise_general_exception = False
        self.exception_message = "Test error"

    async def _load_model(self):
        if self.should_raise_general_exception:
            raise RuntimeError(self.exception_message)
        self.model_loaded = True
        self.state = ToolState.READY

    async def _unload_model(self):
        self.model_loaded = False
        self.state = ToolState.UNLOADED

    async def _predict(self, input: ToolInput) -> ToolOutput:
        if self.should_raise_http_exception:
            raise HTTPException(status_code=400, detail="Predict HTTP error")
        if self.should_raise_general_exception:
            raise RuntimeError(self.exception_message)

        # Mock prediction logic
        results = []
        for sentence in input.sentences:
            if "heart" in sentence.lower():
                results.append(
                    [PhenotypeMatch(id="HP:0000001", match_text="heart defect")]
                )
            elif "short stature" in sentence.lower():
                results.append(
                    [PhenotypeMatch(id="HP:0000002", match_text="short stature")]
                )
            else:
                results.append([])
        return ToolOutput(results=results)

    def _get_model_info(self) -> ToolInfo:
        return ToolInfo(
            name="Test Tool",
            version="1.0.0",
            description="A test tool for API testing",
            author="Test Author",
        )

    async def load(self) -> LoadResponse:
        if self.should_raise_http_exception:
            raise HTTPException(status_code=500, detail="Load HTTP error")
        return await super().load()

    async def unload(self) -> UnloadResponse:
        if self.should_raise_general_exception:
            raise RuntimeError(self.exception_message)
        return await super().unload()

    async def predict(self, input_data: ToolInput) -> ToolResponse:
        return await super().predict(input_data)

    async def batch_predict(self, input_data: ToolBatchInput) -> ToolBatchResponse:
        if self.should_raise_http_exception:
            raise HTTPException(status_code=400, detail="Batch predict HTTP error")
        return await super().batch_predict(input_data)


class TestCreateApp:
    """Test class for create_app function."""

    def test_create_app_returns_fastapi_instance(self):
        """Test that create_app returns a FastAPI instance."""
        mock_model = MockModelImplementation()
        app = create_app(mock_model)

        from fastapi import FastAPI

        assert isinstance(app, FastAPI)
        assert app.title == "Goldmine Tool API"
        assert app.description == "Standard API for Goldmine tool containers"
        assert app.version == "1.0.0"


class TestStatusEndpoint:
    """Test class for /status endpoint."""

    def test_status_endpoint_success(self):
        """Test successful status endpoint call."""
        mock_model = MockModelImplementation()
        app = create_app(mock_model)
        client = TestClient(app)

        response = client.get("/status")

        assert response.status_code == 200
        data = response.json()
        assert data["state"] == "unloaded"
        assert data["message"] is None

