class TestPredictEndpoint:
    """Test class for /predict endpoint."""

    def test_predict_endpoint_success(self):
        """Test successful predict endpoint call."""
        mock_model = MockModelImplementation()
        mock_model.model_loaded = True
        mock_model.state = ToolState.READY
        app = create_app(mock_model)
        client = TestClient(app)

        input_data = {"sentences": ["Patient has heart defect", "No symptoms found"]}

        response = client.post("/predict", json=input_data)

        assert response.status_code == 200
        data = response.json()
        assert "results" in data
        assert "processing_time" in data
        assert len(data["results"]) == 2
        assert len(data["results"][0]) == 1  # Heart defect found
        assert len(data["results"][1]) == 0  # No matches

    def test_predict_endpoint_http_exception(self):
        """Test predict endpoint with HTTP exception."""
        mock_model = MockModelImplementation()
        app = create_app(mock_model)
        client = TestClient(app)

        # Load the model
        client.post("/load")

        mock_model.should_raise_http_exception = True

        input_data = {"sentences": ["Test sentence"]}
        response = client.post("/predict", json=input_data)

        assert response.status_code == 400
        data = response.json()
        assert "Predict HTTP error" in data["detail"]

    def test_predict_endpoint_general_exception(self):
        """Test predict endpoint with general exception."""
        mock_model = MockModelImplementation()
        mock_model.model_loaded = (
            True  # Model needs to be loaded for prediction to occur
        )
        mock_model.state = ToolState.READY
        mock_model.should_raise_general_exception = True
        mock_model.exception_message = "General predict error"
        app = create_app(mock_model)
        client = TestClient(app)

        input_data = {"sentences": ["Test sentence"]}
        response = client.post("/predict", json=input_data)

        assert response.status_code == 500
        data = response.json()
        assert (
            "An unexpected error occurred during prediction: General predict error"
            in data["detail"]
        )


