    def test_external_recommender_predict_http_exception(self):
        """Test external recommender predict with HTTP exception."""
        mock_model = MockModelImplementation()
        mock_model.model_loaded = True  # Model needs to be loaded to avoid load error
        mock_model.state = ToolState.READY
        mock_model.should_raise_http_exception = True
        app = create_app(mock_model)
        client = TestClient(app)

        request_data = {
            "document": {"xmi": self.xmi_document},
            "metadata": {
                "layer": "test.Phenotype",
                "feature": "value",
                "projectId": 456,
                "anchoringMode": "characters",
                "crossSentence": True,
            },
            "typeSystem": self.type_system,
        }

        # The predict method will be called during XMI processing, which throws HTTP exception
        with patch("goldmine.toolkit.api.load_typesystem") as mock_load_typesystem:
            mock_typesystem = Mock()
            mock_annotation_type = Mock()
            mock_typesystem.get_type.return_value = mock_annotation_type
            mock_load_typesystem.return_value = mock_typesystem

            with patch("goldmine.toolkit.api.load_cas_from_xmi") as mock_load_cas:
                mock_cas = Mock()
                mock_view = Mock()
                mock_view.sofa_string = "Patient has heart defect"
                mock_cas.get_view.return_value = mock_view
                mock_load_cas.return_value = mock_cas

                response = client.post(
                    "/external-recommender/predict", json=request_data
                )

        assert response.status_code == 400
        data = response.json()
        assert "Predict HTTP error" in data["detail"]

