class TestExternalRecommenderLogic:
    """Test class for external recommender internal logic without HTTP complications."""

    def test_external_recommender_hpo_id_conversion(self):
        """Test HPO ID conversion in external recommender."""
        # This tests the specific line: hpo_id = match.id.replace(":", "_")
        from goldmine.types import PhenotypeMatch

        match = PhenotypeMatch(id="HP:0000001", match_text="heart defect")
        hpo_id = match.id.replace(":", "_")
        assert hpo_id == "HP_0000001"


